    if len(s) <= 3:
        return False
    count = {}
    for c in s:
        if c in count:
            count[c] += 1
        else:
            count[c] = 1
    for key in count:
        if count[key] < 2 or s.find(key * 2) != -1:
            return False
    triset = set()
    for i in range(len(s) - 2):
        triplet = s[i:i + 3]
        if triplet in triset:
            return False
        triset.add(triplet)
    return True

